function add(a=prompt("1 Number"), b=prompt("2 Number")) {


  let add = a + b;
  return add;
}
function sub(a, b) {
  let sub = a - b;
  return sub;
}
function div(a, b) {
  let div = a / b;
  div = div.toFixed(1);
  return div;
}
function multi(a, b) {
  let multi = a * b;
  return multi;
}
